#! /usr/bin/env node
import type { Configs, Paths } from './argv';
export type extensionConfigs = {
    environment: string;
    watchFiles: string[];
    ignoreFiles: string[];
    duplicates: boolean;
    openInside: boolean;
    showInfoMsg: boolean;
    statusBar: {
        show: 'true' | 'false';
        position: 'Right' | 'Left';
        priority: string | number;
    };
};
export type CliOptions = Partial<Paths & Configs> & Partial<extensionConfigs>;
